  false,\n\t\"url\": null,\n\t\"notes\": \" NOAA CoastWatch provides surface temperature
  products derived from NOAA's Polar Operational Environmental Satellites (POES).
  \ This data is provided at high resolution (0.0125 degrees) for the North Pacific
  Ocean.  Measurements are gathered by the Advanced Very High Resolution Radiometer
  (AVHRR) instrument, a multiband radiance sensor carried aboard the NOAA POES satellites.
